import React, { Component } from 'react';

class App extends Component {
  constructor() {
    super();
    this.state = { displayBio: true };
  }

  render() {
    let bio = this.state.displayBio ? (
      <div>
        <p>My favorite language is JavaScript</p>
        <p>I love React!</p>
      </div>
    ) : null;

    return (
      <div>
        <h1>Hello!</h1>
        <p>My name is Johnny!</p>
        <p>I love life!</p>
        {bio}
      </div>
    )
  } 
};

export default App;
